파키스탄 이슬람아바드(CNN) - 파키스탄 대통령 아시프 알리 자르다리는 화요일 CNN에 따르면, 블라스미 법으로 사형을 선고 받은 기독교 여성을 사면할 것이다. 펀자브 주지사는 CNN 인터내셔널 "Connect the World" 프로그램에서 "그가 명확하게 말한 것은 그녀가 이 법의 희생양이 되지 않을 것이라는 것입니다."라고 말합니다. "그는 진보적이고 현대적인 대통령입니다. 그리고 가난한 여성이 이런 식으로 겨냥되어 처형당하지 않도록 할 것입니다... 그런 일은 일어나지 않을 겁니다." Taseer 주지사는 말합니다. 15개월 가까운 기간 동안 구금된 아시아 비비(Asia Bibi)씨는 지난 달 파키스탄 법원에서 이슬람의 선견자 모하메드를 모욕하여 논란 중인 블라스미법 위반으로 유죄 판결을 받았으며, 파키스탄 형법에 따르면 사형 또는 유금형의 형량이 부과됩니다. 그녀는 사형을 선고받았습니다.

@highlight
펀자브 주지사는 CNN에게 아시아 비비를 석방해야 한다고 말합니다.
@highlight
그녀는 이슬람의 선견자 모하메드를 모욕한 혐의로 사형을 선고 받았습니다.
@highlight
"Taseer 주지사는 그녀가 이 법의 희생양이 되지 않을 것입니다."라고 합니다.
그녀가 구금 중인 감옥에서 짧은 뉴스 회견에서 @placeholder씨는 그녀에 대한 혐의가 그녀를 싫어하는 여성들에 의해 만들어진 거짓말이라고 말했습니다.

위 질문에서 "@placeholder"은 무엇을 의미합니까?

